import React from "react";

import aurora from "../img/image1.jpg";

class Portfolio extends React.Component {

  constructor() {
    super();
    this.state = {
      about_me: [
        {
          id: "first-p-about",
          content:
            "Founded a business specializing in the distribution of private residential and data center proxies"
        },
        {
          id: "second-p-about",
          content:
            "            Worked in a fullstack MERN role developing a dashboard & checkout site in Javascript w React Material frontend, NodeJS backend, Mongo DB storage, Stripe payment system, and Oxy proxy generation APIs"
        },
        {
          id: "third-p-about",
          content:
          "In my freetime I enjoy playing video games, coding, hiking, playing tennis, building businesses, and spending time with my family and friends.  If you would like to get in touch with me, please feel free to reach out to me on LinkedIn or send me an email."
        },
        {

        }
      ]
    };
  }
  render() {
    return (
      <section id="work" className="portfolio-mf sect-pt4 route">
        <div className="container">
        <div className="row">
            <div className="col-sm-12">
              <div className="box-shadow-full">
                <div className="row">
                  <div className="about-me pt-4 pt-md-0">
                    <div className="title-box-2">
                      <h5 className="title-left">Aurora Proxies</h5>
                    </div>
                    {this.state.about_me.map(content => {
                      return (
                        <p className="lead" key={content.id}>
                          {content.content}
                        </p>
                      );
                    })}
                  </div>

                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default Portfolio;
